Turning 32

Sociopolitical Documentary hosted by Robbie Heart, published by NFB in 2010 - English narration


Information
------------------------------

A feature documentary film in the works for the past 16 years, TURNING 32 is the captivating sequel to the award-winning tv series filmed around the world in 1992 titled TURNING 16. The original series aired in 40 countries and captured the hearts of millions, with the poignant stories of six diverse teenagers growing up in the so-called &quot;developing world&quot;... each dealing with unique personal challenges, each with passionate dreams, each facing the rite of passage of... turning sixteen
Today, 16 years later, we've embarked on a second journey to find our old friends and to see who they have become and what has happened to their dreams. TURNING 32 is the result... a film steeped in emotion, culture and the passage of time. A universal tale about growing up and the life lessons that come with it.

